import React from "react";
import Nitin from './Nitin.jpg'

const Home = () => {
  return (
    <>
      <div className="container d-flex my-5">
        <div className="container text-center">
            <div className="text-center text-success" style={{fontSize:"2rem"}}>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Architecto omnis commodi magni reprehenderit debitis ea earum, fuga optio quasi odio ad ut officiis quam itaque perferendis praesentium, iste aut. Commodi est natus praesentium quas nostrum.</div>
        </div>
        <div className="container text-center">
           <img src={Nitin} alt="Nitin_Img" style={{width:"50%", borderRadius:"50%"}}/>
        </div>
      </div>
    </>
  );
};

export default Home;
